import { useSelector, useDispatch } from "react-redux";
import { useNavigate } from "react-router-dom";
import { useEffect } from "react"
import {logOutRedux} from "../store/user/actions";;
const Profile = () => {
  const dispatch = useDispatch()
  const user = useSelector((state) => state.user);
  const navigate = useNavigate()
  useEffect( () => {
    if(user.sessionData.loggedIn === false) {
    navigate("/login")
  }
  },[])
  const logOut = () => {
    dispatch(logOutRedux());
    navigate("/login")
  }
  return <div>

    {user.sessionData.loggedIn ?
      <div>email: {user.sessionData.email} <br/>
        password: {user.sessionData.password} <br/>
        gender: {user.users[user.sessionData.email].gender} <br/>
        name: {user.users[user.sessionData.email].name} <br/>
        lastName: {user.users[user.sessionData.email].lastName} <br/>
       <button onClick={logOut}>logOut</button>
      </div>
    : null}


  </div>
}
export default Profile
